"\uff0a \u3053\u306e\u3000\u304d\u3087\u3046\u304b\u3044^1\u3000\u3042\u3044\u307c\u3046\u3068&\u3000 \u3075\u305f\u308a\u3067\u3000\u30da\u30f3\u30ad\u306c\u3063\u305f\u3093\u3060\u305c^1\uff1f&\u3000 \u306a\u304b\u306a\u304b\u306e\u3000\u3057\u3042\u304c\u308a\u3060\u308d\uff1f/%",
