"\\E0\uff0a \u3044\u3084^1\u3000\u3061\u3087\u3063\u3068&\u3000 \u30d7\u30e9\u30d7\u30e9\u3057\u306b&\u3000 \u304d\u305f\u3060\u3051\u3060\u3002/",
