"\uff0a \u3060\u3064\u3054\u304f\u3057\u306a\u304c\u3089\u3000\u3079\u3093\u304d\u3087\u3046\u3057\u305f\u308a&\u3000 \u30de\u30c3\u30bf\u30ea\u3057\u305f\u308a\u3059\u308b\u306e\u306b&\u3000 \u30d4\u30c3\u30bf\u30ea\u306a\u3000\u304d\u3087\u304f\u3092\u3000\u3042\u3064\u3081\u305f\u30e8\u2026/%",
"\uff0a (\u3042\u2026^1\u3000\u3069\u3046\u3057\u3088\u30a6\u2026&\u3000 \u307e\u3061\u304c\u3048\u30c6\u3000\u3051\u3044\u3055\u3064\u304b\u3093\u306b&\u3000 \u306a\u3063\u3061\u3083\u3063\u30bf\u2026)/",
"\uff0a (\u3044\u3068\u3053\u305f\u3061\u306b\u3000&\u3000 \u305f\u3088\u308a\u306b\u3055\u308c\u3066\u308b\u304b\u30e9&\u3000 \u3084\u3081\u3089\u308c\u306a\u3044\u30e8\u2026)/",
